import React from "react";

const TotalCounter = (props) => {
  return (
    <div>
      <div className="row ">
        <div className="col-lg-2 col-sm-6 is-light-text mb-4">
          {props.data[0]}
        </div>
      </div>
      <div className="row ">
        <div className="col-lg-2 col-sm-6 is-light-text mb-4">
          {props.data[1]}
        </div>
      </div>
      <div className="row ">
        <div className="col-lg-2 col-sm-6 is-light-text mb-4">
          {props.data[2]}
        </div>
      </div>
    </div>
  );
};

export default TotalCounter;
